__NUXT_JSONP__("/drugs/Tepotinib", (function(a,b,c){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"1100598-32-0",chebiId:b,chemicalFormula:b,definition:"An orally bioavailable inhibitor of MET tyrosine kinase with potential antineoplastic activity. Tepotinib selectively binds to MET tyrosine kinase and disrupts MET signal transduction pathways, which may induce apoptosis in tumor cells overexpressing this kinase. The receptor tyrosine kinase MET (also known as hepatocyte growth factor receptor or HGFR), is the product of the proto-oncogene c-Met and is overexpressed or mutated in many tumor cell types; this protein plays key roles in tumor cell proliferation, survival, invasion, and metastasis, and tumor angiogenesis.",fdaUniiCode:"1IJV77EI07",identifier:"C88314",preferredName:a,semanticType:"Pharmacologic Substance",subclassOf:["C129825","C143099"],synonyms:["Benzonitrile, 3-(1,6-Dihydro-1-((3-(5-((1-methyl-4-piperidinyl)methoxy)-2-pyrimidinyl)phenyl)methyl)-6-oxo-3-pyridazinyl)-","EMD 1214063","EMD-1214063","EMD1214063","TEPOTINIB",a]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FTepotinib",extension:".json",createdAt:c,updatedAt:c}}],fetch:{},mutations:void 0}}("Tepotinib","","2021-10-30T13:46:53.793Z")));